import {useEffect, useState} from "react";
import { BrowserRouter, Routes, Route, useNavigate } from 'react-router-dom';
import Main from "./pages/main/Main";
import Login from "./pages/mypage/Login";
import StorageList from "./pages/storage/StorageList";
import Logout from "./pages/mypage/Logout";
import DetaileStorage from "./pages/storage/DetaileStorage";
import {authService} from "./firebase";

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(authService.currentUser);
  useEffect(() => {
    authService.onAuthStateChanged((user) => console.log(user));
  }, []);

  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          {isLoggedIn ?
            <>
              <Route path='/' element={<Main />}></Route>
              <Route path='/logout' element={<Logout/>}></Route>
              <Route path='/storagelist' element={<StorageList />}></Route>
              <Route path='/detailestorage' element={<DetaileStorage />}></Route>
            </> :
            <>
              <Route path='/' element={<Login isLoggedIn={isLoggedIn}/>}></Route>
            </>
          }
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
